scriptlet.script:
var pr = scriptletContext.get("RS_Previous_Response");
var labID = scriptletContext.get("labID");
switch(pr) {
	case "more items":
		if(output.trim().length > 0) {
			if(labID != undefined) {
				labID = labID.concat(",",output);
				scriptletResponse = "failure";
				scriptletContext.put("FailureMessage","Multiple Lab Ids returned. It should be only one");
			}
			else {
				labID = output;
			}
			scriptletContext.put("labID",labID);
		}
		scriptletResponse = "more";
	break;

	case "no more items":
		if(labID != undefined) {			
			var properties = JSON.parse(programProperties);
			properties['labID'] = labID;
			scriptletContext.put("programProperties",JSON.stringify(properties));
			scriptletResponse = "complete";
		}
		else {
			scriptletResponse = "failure";
			scriptletContext.put("FailureMessage","No Lab Id returned");
		}
	break;

	case udefined:
		scriptletResponse = "failure";
		scriptletContext.put("FailureMessage","Datatabse Error:" + output);
	break;
}

