function debug(input) {
	var os = input['optionModel']['optionSets'];
    // Program Option
    var program = os.filter(function(i) {
        return i['displayName'] === "Select Program";
    })[0];
    return program;
}


function getCommonProperties(input) {
    //Options Sets
    var os = input['optionModel']['optionSets'];
    // Program Option
    var program = os.filter(function(i) {
        return i['displayName'] === "Select Program";
    })[0]["options"].filter(function(i) {
        return i['isSelected'] === true;
    })[0];

    var properties = {};
    var programName = program['displayName'];
    properties['programName'] = programName;

    var property = program['property'];
    if(programName === "CDF Enablement") {
        var productSuite = property.filter(function(i) {return i['name'] === "productSuite";})[0]['values'][0]['value'];
        properties['productSuite'] = productSuite;
    }
    else if(programName === "CMT") {
        var customerName = property.filter(function(i) {return i['name'] === "customerName";})[0]['values'][0]['value'];
        var regionName = property.filter(function(i) {return i['name'] === "regionName";})[0]['values'][0]['value'];
        var fixedPool = property.filter(function(i) {return i['name'] === "fixedPool";})[0]['values'][0]['value'];
        var resourcing = property.filter(function(i) {return i['name'] === "resourcing";})[0]['values'][0]['value'];
        properties['customerName'] = customerName.trim();
        properties['regionName'] = regionName;
        properties['fixedPool'] = parseInt(fixedPool);
        properties['resourcing'] = resourcing.trim();
    }
    var keyValidation = property.filter(function(i) {return i['name'] === "keyValidation";})[0]['values'][0]['value'];
    var publicKey = property.filter(function(i) {return i['name'] === "publicKey";})[0]['values'][0]['value'];
    properties['keyValidation'] = keyValidation;
    properties['publicKey'] = publicKey;
    return properties;
}

try {
	var properties = JSON.parse(programProperties);
	var programName = properties['programName'];
	var sql;
		if(programName === "CDF Enablement") {
			var productSuite = properties['productSuite'];
			sql = "select ID from ENA_LABS where PROGRAM = '" + programName + "' and SUITE = '" + productSuite + "'"; 
		}
		else if (programName === "CMT") {
			var regionName = properties['regionName'];
			sql = "select ID from ENA_LABS where PROGRAM = '" + programName + "' and REGION = '" + regionName + "'";
		}
		else {
			throw new Error("Program name unknown: " + programName);
		}
		scriptletResult = sql;
		scriptletContext.put("SQL",sql);
		scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

try {
	var docs = JSON.parse(document);
