}

function getServerConfiguration(input) {
                // Return Options Sets for enabled servers
                var serverOptions = [];
                input['optionModel']['optionSets'].filter(function(i) {
                    return i['displayName'] === "Select Program";
                })[0]["options"].filter(function(i) {
                    return i['isSelected'] === true;
                })[0]['childOptionSets'].filter(function(i) {
                    return i['options'].filter(function(j) {return j['displayName'] === "Enable Server";})[0]['isSelected'] === true;
                }).map(function(i) {
                    return i['options'].filter(function(j) { return j['displayName'] === "Enable Server";})[0];
                }).forEach(function(j) {
                    j['childOptionSets'].forEach(function(s) {
                        serverOptions.push(s);
                    });
                });

                var re = new RegExp('(s[1-9])_([a-zA-Z0-9]+)');

                var serverProperties = {}; 
                serverOptions.map(function(i) {
                    return i['options'][0]['property'][0];
                }).forEach(function(p) {
                    if((m = p['name'].match(re)) !== null) {
                        if(serverProperties.hasOwnProperty(m[1])) {
                            var tmp = serverProperties[m[1]];
                            tmp[m[2]] = (p['values'].length > 0)? p['values'][0]['value']: null;
                        } 
                        else {
                            var tmp = {};
                            tmp['counter'] = m[1].substr(1,1);
                            tmp[m[2]] = (p['values'].length > 0)? p['values'][0]['value']: null;                           
                        }
                        serverProperties[m[1]] = tmp;
                    }
                });

                serverProperties = sortProperties(serverProperties);
                return serverProperties;
            }

            function sortProperties(sp) {
                var servers = Object.keys(sp);
                servers.sort(function(a,b) {
                    if(a<b) {
                        return -1;
                    }
                    else if (a>b) {
                        return 1;
                    }
                    else {
                        return 0;
                    }                   
                });

                var tmp = {};
                servers.forEach(function(s) {
                    tmp[s] = sp[s];
                });
                return tmp;
            }
